// import { useState } from "react";

// @mui material components
import Grid from "@mui/material/Grid";
// import Icon from "@mui/material/Icon";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
// import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
// import Footer from "examples/Footer";
// import MiniStatisticsCard from "examples/Cards/StatisticsCards/MiniStatisticsCard";

import { Table } from 'react-bootstrap';
  // Soft UI Dashboard PRO React examples
  import DataTable from "examples/Tables/DataTable";


function Widgets() {
  // const [lights, setLights] = useState(false);

  // const handleSetLights = () => setLights(!lights);

  return (

    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox py={1}>


        <Grid container>

          <Grid item xs={15} lg={12} py={.05}>
            <SuiBox mb={3}>

              <Table striped bordered hover size="sm" style={{ textAlign: "center" }}>
                <thead>
                  <tr>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}>AMC</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}>Invested Amount</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}>AUM</th>

                  </tr>
                </thead>
              </Table>

              <Table striped bordered hover size="sm" style={{ textAlign: "center", borderColor: 'black' }}>
                <tbody>
                  <tr>
                    <td style={{ width: '200px', padding: "10px" }}>Aditya Birla Sun Life Mutual Fund</td>
                    <td style={{ width: '200px', padding: "10px" }}>5,72,45,790</td>
                    <td style={{ width: '200px', padding: "10px" }}>7,30,92,892
                    </td>
                  </tr>
                  <tr>
                    <td style={{ Color: "#038d8a", padding: "10px" }}>ICICI Prudential Mutual Fund</td>
                    <td>4,37,75,594</td>
                    <td>4,76,04,994</td>
                  </tr>
                  <tr>
                    <td style={{ Color: "#038d8a", padding: "10px" }}>UTI Mutual Fund</td>
                    <td>1,47,60,680</td>
                    <td>1,72,64,262</td>
                  </tr>
                  <tr>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd", padding: "10px" }}> Total</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>15,33,16,151</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>Nill</td>
                  </tr>

                </tbody>
              </Table>

              // Soft UI Dashboard PRO React examples
              import DataTable from "examples/Tables/DataTable";

              <DataTable
                table={{
                  columns: [
                    { Header: "name", accessor: "name", width: "25%" },
                    { Header: "position", accessor: "position", width: "30%" },
                    { Header: "office", accessor: "office" },
                    { Header: "age", accessor: "age", width: "12%" },
                  ],
                  rows: [
                    {
                      name: "Hanny Baniard",
                      position: "Data Coordiator",
                      office: "Baorixile",
                      age: 42,
                      startDate: "4/11/2021",
                      salary: "$474,978",
                    },
                    {
                      name: "Lara Puleque",
                      position: "Payment Adjustment Coordinator",
                      office: "Cijangkar",
                      age: 47,
                      startDate: "8/2/2021",
                      salary: "$387,287",
                    },
                    {
                      name: "Torie Repper",
                      position: "Administrative Officer",
                      office: "Montpellier",
                      age: 25,
                      startDate: "4/21/2021",
                      salary: "$94,780",
                    },
                    {
                      name: "Nat Gair",
                      position: "Help Desk Technician",
                      office: "Imider",
                      age: 57,
                      startDate: "12/6/2020",
                      salary: "$179,177",
                    },
                    {
                      name: "Maggi Slowan",
                      position: "Help Desk Technician",
                      office: "Jaunpils",
                      age: 56,
                      startDate: "11/7/2020",
                      salary: "$440,874",
                    },
                    {
                      name: "Marleah Snipe",
                      position: "Account Representative II",
                      office: "Orekhovo-Borisovo Severnoye",
                      age: 31,
                      startDate: "7/18/2021",
                      salary: "$404,983",
                    },
                    {
                      name: "Georgia Danbury",
                      position: "Professor",
                      office: "Gniezno",
                      age: 50,
                      startDate: "10/1/2020",
                      salary: "$346,576",
                    },
                    {
                      name: "Bev Castan",
                      position: "Design Engineer",
                      office: "Acharnés",
                      age: 19,
                      startDate: "1/14/2021",
                      salary: "$445,171",
                    },
                    {
                      name: "Reggi Westney",
                      position: "Financial Advisor",
                      office: "Piuí",
                      age: 56,
                      startDate: "3/21/2021",
                      salary: "$441,569",
                    },
                    {
                      name: "Bartholomeus Prosh",
                      position: "Project Manager",
                      office: "Kelīshād va Sūdarjān",
                      age: 28,
                      startDate: "5/27/2021",
                      salary: "$336,238",
                    },
                    {
                      name: "Sheffy Feehely",
                      position: "Software Consultant",
                      office: "Ndibène Dahra",
                      age: 27,
                      startDate: "3/23/2021",
                      salary: "$473,391",
                    },
                    {
                      name: "Euphemia Chastelain",
                      position: "Engineer IV",
                      office: "Little Baguio",
                      age: 63,
                      startDate: "5/1/2021",
                      salary: "$339,489",
                    },
                  ]
                }}
              />
            </SuiBox>

          </Grid>
        </Grid>
      </SuiBox>


    </DashboardLayout>
  );
}

export default Widgets;
